AIStatsChatCompletionsRequest::Service_tierEnum AIStatsChatCompletionsRequest::toService_tierEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("flex")) {
        return Service_tierEnum::FLEX;
    }
    
    if (value == utility::conversions::to_string_t("standard")) {
        return Service_tierEnum::STANDARD;
    }
    
    if (value == utility::conversions::to_string_t("priority")) {
        return Service_tierEnum::PRIORITY;
    }
    
    throw std::invalid_argument("Invalid value for conversion to Service_tierEnum");
}


const utility::string_t AIStatsChatCompletionsRequest::fromService_tierEnum(const Service_tierEnum value) const
{
    switch(value)
    {
        
        case Service_tierEnum::FLEX: return utility::conversions::to_string_t("flex");
        
        case Service_tierEnum::STANDARD: return utility::conversions::to_string_t("standard");
        
        case Service_tierEnum::PRIORITY: return utility::conversions::to_string_t("priority");
        
    }
}


